int main() {
	std::fstream file;
	file.open("27-158a.txt");
	if (!file.is_open()) {
		std::cout << "error file";
		return 0;
	}

	std::string line;
	int d, n, t;
	file >> n >> d >> t;
	std::vector<int> vec;
	while (std::getline(file, line)) {
		if (line != "")
			vec.push_back(std::stoi(line));
	}


	std::vector<std::pair<int, int>> non_div;
	for (int i = 0; i < vec.size(); ++i) {
		if (vec[i] % d != 0)
			non_div.push_back({ vec[i], i });
	}
	
	int max = 0;
	for (int i = 0; i < non_div.size(); ++i) {
		for (int j = i + 1; j < non_div.size(); ++j) {
			int first = std::min(non_div[i].second, non_div[j].second) + 1;
			int second = std::max(non_div[i].second, non_div[j].second) - 1;
			int count = 0;
			for (int k = first; k < second; ++k) {
				if (vec[k] % d == 0)
					++count;
			}
			if (count == t)
				if (max < non_div[i].first + non_div[j].first)
					max = non_div[i].first + non_div[j].first;
		}
	} 

	std::cout << max;
	file.close();
	return 0;
}

