using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using DG.Tweening;
using UnityEngine.AI;

public class ArmyFormation : MonoBehaviour {
    public static ArmyFormation Instance;
    public Transform player;
    public Transform boss;
    public CameraFollow mainCamera;
    public float formationRadius = 5f;
    public float formationSpacing = 1.5f;

    public List<Transform> followers;
    public List<GameObject> environmentObjects = new List<GameObject>();

    private void Awake()
    {
        Instance = this;
    }
    public void SetArmyFormation()
    {
        followers = GameManager.Instance.followersList;

        FollowerScript[] followerstodeactivate = FindObjectsOfType<FollowerScript>();

        foreach (var followerstoHide in followerstodeactivate)
        {
            if (!followerstoHide.isFollowingLeader)
            {
                followerstoHide.gameObject.SetActive(false);
            }
        }

        int followersCount = followers.Count;
        float columnSpacing = 1.5f; // Spacing between columns of followers
        int followersPerColumn = 8; // Number of followers per column

        player.rotation = Quaternion.identity;

        int currentColumn = 0;
        int currentRow = 0;
        float offsetX = -(followersPerColumn - 1) * columnSpacing * 0.5f;
        float offsetZ = -2f; // Offset behind the player

        for (int i = 0; i < followersCount; i++)
        {
            float columnOffset = currentColumn * columnSpacing;
            float rowOffset = currentRow * columnSpacing;

            Vector3 positionOffset = new Vector3(offsetX + rowOffset, 0f, offsetZ - columnOffset); // Subtract columnOffset from offsetZ
            Vector3 targetPosition = player.position + positionOffset;

            Vector3 finalPosition = GetClearPosition(targetPosition, i);
            //followers[i].position = finalPosition;
            Transform follower = followers[i];
            //follower.GetComponent<CapsuleCollider>().enabled = false;
            //follower.DOMove(finalPosition, 3f).OnUpdate(() =>
            //{
            //    follower.LookAt(finalPosition); // Update the rotation continuously while moving

            //    FollowerScript followerScript = follower.GetComponent<FollowerScript>();
            //    if (followerScript != null)
            //    {
            //        followerScript.UpdateAnimationsIfFollowingPlayer();
            //    }
            //}).OnComplete(() =>
            //{
            //    follower.rotation = Quaternion.identity; 
            //    FollowerScript followerScript = follower.GetComponent<FollowerScript>();
            //    if (followerScript != null)
            //    {
            //        followerScript.thisAnimator.currentAnimState = 3;
            //    }
            //});
            follower.transform.position = finalPosition;
            follower.rotation = Quaternion.identity;
            FollowerScript followerScript = follower.GetComponent<FollowerScript>();
            if (followerScript != null)
            {
                followerScript.thisAnimator.currentAnimState = 3;
            }

            currentRow++;

            if (currentRow >= followersPerColumn)
            {
                currentColumn++;
                currentRow = 0;
            }
        }

        for (int i = 0; i < environmentObjects.Count; i++)
        {
            environmentObjects[i].SetActive(false);
        }

        mainCamera.isInFightingZone = true;
        //mainCamera.transform.position = new Vector3(0, 22, -15);
        GameManager.isGameEnded = true;
        GameManager.isGameStarted = false;
        InGame.Instance.showTimeUpPanel();
        boss.transform.position = new Vector3(player.position.x, player.position.y, player.position.z + 25);
        addFollowersToTheirList();
    }

    public void addFollowersToTheirList()
    {
        for (int i = 0; i < followers.Count; i++)
        {
            if (followers[i].GetComponent<FollowerScript>().followerType == FollowerType.normal)
            {
                BossFightUI.Instance.normalFollowers.Add(followers[i]);
            }
            if (followers[i].GetComponent<FollowerScript>().followerType == FollowerType.javelin)
            {
                BossFightUI.Instance.javelinFollowers.Add(followers[i]);
            }
            if (followers[i].GetComponent<FollowerScript>().followerType == FollowerType.armor)
            {
                BossFightUI.Instance.armorFollowers.Add(followers[i]);
            }
            if (followers[i].GetComponent<FollowerScript>().followerType == FollowerType.gun)
            {
                BossFightUI.Instance.gunFollowers.Add(followers[i]);
            }
            if (followers[i].GetComponent<FollowerScript>().followerType == FollowerType.bazooka)
            {
                BossFightUI.Instance.bazookaFollowers.Add(followers[i]);
            }
        }
    }

    private Vector3 GetClearPosition(Vector3 desiredPosition, int currentIndex)
    {
        Vector3 position = desiredPosition;
        int iterations = 0;
        bool clearPosition = false;

        while (!clearPosition)
        {
            clearPosition = true;
            for (int i = 0; i < currentIndex; i++)
            {
                float distance = Vector3.Distance(followers[i].position, position);
                if (distance < formationSpacing)
                {
                    position += (position - followers[i].position).normalized * (formationSpacing - distance);
                    clearPosition = false;
                }
            }

            iterations++;

            if (iterations > 8)
            {
                break;
            }
        }


        return position;
    }
}
